  

// TypeScript Version: 4.1

/**
* Computes the squared absolute value of a single-precision floating-point number `x`.
*
* @param x - input value
* @returns squared absolute value
*
* @example
* var v = abs2f( -1.0 );
* // returns 1.0
*
* @example
* var v = abs2f( 2.0 );
* // returns 4.0
*
* @example
* var v = abs2f( 0.0 );
* // returns 0.0
*
* @example
* var v = abs2f( -0.0 );
* // returns 0.0
*
* @example
* var v = abs2f( NaN );
* // returns NaN
*/
declare function abs2f( x: number ): number;


// EXPORTS //

export = abs2f;
